import re

def palindrome_of_length_at_least_n(s):
    s = re.sub('[^a-zA-Z]', '', s.lower())
    palindromes = set()
    for i in range(len(s)):
        for j in range(i+2, len(s)+1):
            substring = s[i:j]
            if substring == substring[::-1] and len(substring) >= 33:
                palindromes.add(substring)
    return palindromes
